import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import IndexPage from './pages/index';

class App extends Component {
  state = {
    notes: {
      1: {
        _id:1,
        title: "Hello World",
        body: "This is the body of my app",
        udpatedAt: new Date()
      },
      2: {
        _id:2,
        title: "Note #2",
        body: "note #2",
        udpatedAt: new Date()
      },
    }
  }

  render() {
    return (
      <div className="App">
        <IndexPage notes={this.state.notes}/>
      </div>
    );
  }
}

export default App;
